import UIKit
protocol Shape{
    var name:String{get}
}

protocol HasArea{
    func area()->Double
}

struct Point:Shape{
    let name: String = "point"
    var x:Double
    var y:Double
}

struct Rectangle:Shape,HasArea{
    let name: String = "rectangle"
    var origin:Point
    var width:Double
    var height:Double
    func area() -> Double {
        return width*height
    }
}

